eqBlockSum (BuildBlockSum b w) (BuildBlockSum b_prime w_prime) = (andBool (eqBit b b_prime) (eqBlock w w_prime))
eqPair (BuildPair w1 w2) (BuildPair w_prime1 w_prime2) = (andBool (eqBlock w1 w_prime1) (eqBlock w2 w_prime2))
